{{Infobox school | name = జిల్లా పరిషత్ ఉన్నత పాఠశాల (ZPHS) చిన్నంపేట | city = చినమ్పేట గ్రామం, కృష్ణ జిల్లా | district = కృష్ణ జిల్లా | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 6 - 10 | medium = తెలుగు, ఇంగ్లీష్ | students = 318 మంది | faculty = పధ్నాలుగు మంది }}
ఇది జిల్లా పరిషత్ ఉన్నత పాఠశాల (ZPHS). ఈ పాఠశాల కృష్ణ జిల్లాలో చాట్ రాయ్ పరిధిలో గల చినమ్పేట గ్రామంలో ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28162400403. ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో ఈ పాఠశాల ఉన్నది. ఇందులో ఆరవ తరగతి నుండి పదవ తరగతి వరకు విద్యని తెలుగు, ఇంగ్లీష్ మాధ్యమంలో భోదించబడుతుంది. ఇది బాల బాలికల పాఠశాల. ఈ పాఠశాలలో మొత్తం 318 మంది విద్యార్థులు విద్యని అభ్యసిస్తున్నారు. వీరిలో 160 మంది బాలురు 158 మంది బాలికలు ఉన్నారు. ఇక్కడ ఆరుగురు ఉపాధ్యాయులు ఎనిమిది మంది ఉపాధ్యాయినులు, మొత్తం పధ్నాలుగు మంది ఉపాధ్యాయులు ఉన్నారు. <ref>{{cite web |title =School Directory |url = http://schoolreportcards.in/SRC-New/SchoolDirectory/Directory.aspx |website = schoolreportcards.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2017-18 విద్యా సంవత్సరమునకు సంబంధించినవి.
