{{Infobox school | name = మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS) ( డిపిపి) బీఎస్సార్ నగరం, ఎన్డీకే | city = నందిని కొట్కూర్ గ్రామం, కుర్నూల్ జిల్లా | district = కుర్నూల్ జిల్లా | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 1 - 5 | medium = తెలుగు, ఇంగ్లీష్ | students = అరవై రెండు మంది | faculty = ముగ్గురు }}
ఇది మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS). కుర్నూల్ జిల్లాలో నందికొట్కూరు పరిధిలో నందిని కొట్కూర్ గ్రామంలో ఈ పాఠశాల ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28210800903. ఇది ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో పని చేస్తుంది. ఇక్కడ విద్యార్థులకు ఐదవ తరగతి వరకూ విద్యని తెలుగు, ఇంగ్లీష్ మాధ్యమంలో భోదించబడుతుంది. ఇది బాల బాలికల పాఠశాల. మొత్తం అరవై రెండు మంది విద్యార్థులలో ముప్పై మూడు మంది బాలురు ఇరవై తొమ్మిది మంది బాలికలు ఈ పాఠశాల లో విద్యని అభ్యసిస్తున్నారు. ఇక్కడ ఒక ఉపాధ్యాయుడు ఇద్దరు ఉపాధ్యాయినులు, మొత్తం ముగ్గురు ఉపాధ్యాయులు ఉన్నారు. <ref>{{cite web |title =School Directory |url = http://schoolreportcards.in/SRC-New/SchoolDirectory/Directory.aspx |website = schoolreportcards.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2017-18 విద్యా సంవత్సరమునకు సంబంధించినవి.
