{{Infobox school | name = జిల్లా పరిషత్ ఉన్నత పాఠశాల (ZPHS) కెమ్మూమియాపెట్ ( అమ్మాయిలు) | city = కెమ్మూమైహాపేట గ్రామం, కడప జిల్లా | district = కడప జిల్లా | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 6 - 10 | medium = ఇంగ్లీష్, తెలుగు | students = 270 మంది | faculty = పదహారు మంది }}
ఇది జిల్లా పరిషత్ ఉన్నత పాఠశాల (ZPHS). ఈ పాఠశాల కడప జిల్లాలో కుద్దాపాః పరిధిలో గల కెమ్మూమైహాపేట గ్రామంలో ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28203190221. ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో ఈ పాఠశాల ఉన్నది. ఇందులో ఆరవ తరగతి నుండి పదవ తరగతి వరకు విద్యని ఇంగ్లీష్, తెలుగు మాధ్యమంలో భోదించబడుతుంది. బాలికలకు మాత్రమే ఇక్కడ ప్రవేశం ఉన్నది. 270 మంది బాలికలు ఇక్కడ విద్యని అభ్యసిస్తున్నారు. ఇక్కడ పదహారు మంది ఉపాధ్యాయులు ఉన్నారు, వీరిలో అందరూ ఉపాధ్యాయినులే. <ref>{{cite web |title =School Directory |url = http://schoolreportcards.in/SRC-New/SchoolDirectory/Directory.aspx |website = schoolreportcards.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2017-18 విద్యా సంవత్సరమునకు సంబంధించినవి.
