{{Infobox school | name = మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS) ( లేదు.2) థోకాడ | city = థోకాడ గ్రామం, ఈస్ట్ గోదావరి జిల్లా | district = ఈస్ట్ గోదావరి జిల్లా | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 1 - 5 | medium = తెలుగు | students = నలభై మంది | faculty = ఒక }}
ఇది మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS). ఈ పాఠశాల ఈస్ట్ గోదావరి జిల్లాలో రాజనగరం పరిధిలో గల థోకాడ గ్రామంలో ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28142801102. ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో ఈ పాఠశాల ఉన్నది. ఇక్కడ విద్యార్థులకు ఐదవ తరగతి వరకూ విద్యని తెలుగు మాధ్యమంలో భోదించబడుతుంది. ఇది బాల బాలికల పాఠశాల. ఈ పాఠశాలలో మొత్తం నలభై మంది విద్యార్థులు విద్యని అభ్యసిస్తున్నారు. వీరిలో పదిహేడు మంది బాలురు ఇరవై మూడు మంది బాలికలు ఉన్నారు. ఇది ఏకోపాధ్యాయ పాఠశాల. ఉపాధ్యాయుడు ఉన్నారు.<ref>{{cite web |title =School Directory |url = http://schoolreportcards.in/SRC-New/SchoolDirectory/Directory.aspx |website = schoolreportcards.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2017-18 విద్యా సంవత్సరమునకు సంబంధించినవి.
