{{Infobox school | name = కస్తూర్బా గాంధీ బాలికా విద్యాలయ (KGBV) క్రిష్ణగైరి | city = క్రిష్ణగైరి గ్రామం, కుర్నూల్ జిల్లా | district = కుర్నూల్ జిల్లా | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 6 - 10 | medium = ఇంగ్లీష్ | students = 212 మంది | faculty = తొమ్మిది మంది }}
ఇది కస్తూర్బా గాంధీ బాలికా విద్యాలయ (KGBV). ఈ పాఠశాల క్రిష్ణగైరి గ్రామంలో ఉన్నది. ఈ గ్రామం కుర్నూల్ జిల్లాలో క్రిష్ణగైరి పరిధిలో ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28212800505. కేజీబీవీలు ( ఎస్ఎస్ఏ) నిర్వహణలో ఈ పాఠశాల ఉన్నది. ఇందులో ఆరవ తరగతి నుండి పదవ తరగతి వరకు విద్యని ఇంగ్లీష్ మాధ్యమంలో భోదించబడుతుంది. ఇది బాలికల పాఠశాల. 212 మంది బాలికలు ఇక్కడ విద్యని అభ్యసిస్తున్నారు. ఇక్కడ తొమ్మిది మంది ఉపాధ్యాయులు ఉన్నారు, వీరిలో అందరూ ఉపాధ్యాయినులే. <ref>{{cite web |title =School Directory |url = http://schoolreportcards.in/SRC-New/SchoolDirectory/Directory.aspx |website = schoolreportcards.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2017-18 విద్యా సంవత్సరమునకు సంబంధించినవి.
