{{Infobox school | name = మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS) ( సీపీ) వెంటూరు | city = వెంటూరు గ్రామం, ఈస్ట్ గోదావరి జిల్లా | district = ఈస్ట్ గోదావరి జిల్లా | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 1 - 5 | medium = తెలుగు | students = ఇరవై మూడు మంది | faculty = ఇద్దరు }}
ఇది మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS). ఈ పాఠశాల ఈస్ట్ గోదావరి జిల్లాలో రాయవరం పరిధిలో గల వెంటూరు గ్రామంలో ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28144000805. ఇది ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో పని చేస్తుంది. ఇక్కడ విద్యార్థులకు ఐదవ తరగతి వరకూ విద్యని తెలుగు మాధ్యమంలో భోదించబడుతుంది. ఇది బాల బాలికల పాఠశాల. మొత్తం ఇరవై మూడు మంది విద్యార్థులలో పది మంది బాలురు పదమూడు మంది బాలికలు ఈ పాఠశాల లో విద్యని అభ్యసిస్తున్నారు. ఇక్కడ మొత్తం ఇద్దరు ఉపాధ్యాయులు ఉన్నారు. వీరిలో ఒక ఉపాధ్యాయుడు ఒక ఉపాధ్యాయిని ఉన్నారు. <ref>{{cite web |title =School Directory |url = http://schoolreportcards.in/SRC-New/SchoolDirectory/Directory.aspx |website = schoolreportcards.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2017-18 విద్యా సంవత్సరమునకు సంబంధించినవి.
