{{Infobox school | name = జిల్లా పరిషత్ ఉన్నత పాఠశాల (ZPHS) విజెపిహెచ్ ఎస్ మోదుకూరు | city = మోదుకూరు గ్రామం, గుంటూరు జిల్లా | district = గుంటూరు జిల్లా | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 6 - 10 | medium = తెలుగు, ఇంగ్లీష్ | students = 272 మంది | faculty = పదిహేను మంది }}
ఇది జిల్లా పరిషత్ ఉన్నత పాఠశాల (ZPHS). ఈ పాఠశాల గుంటూరు జిల్లాలో తుసుందూరు పరిధిలో గల మోదుకూరు గ్రామంలో ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28173301206. ఇది ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో పని చేస్తుంది. ఇందులో ఆరవ తరగతి నుండి పదవ తరగతి వరకు విద్యని తెలుగు, ఇంగ్లీష్ మాధ్యమంలో భోదించబడుతుంది. ఇది బాల బాలికల పాఠశాల. ఈ పాఠశాలలో మొత్తం 272 మంది విద్యార్థులు విద్యని అభ్యసిస్తున్నారు. వీరిలో 143 మంది బాలురు 129 మంది బాలికలు ఉన్నారు. ఇక్కడ మొత్తం పదిహేను మంది ఉపాధ్యాయులు ఉన్నారు. వీరిలో పదకొండు మంది ఉపాధ్యాయులు నలుగురు ఉపాధ్యాయినులు ఉన్నారు. <ref>{{cite web |title =School Directory |url = http://schoolreportcards.in/SRC-New/SchoolDirectory/Directory.aspx |website = schoolreportcards.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2017-18 విద్యా సంవత్సరమునకు సంబంధించినవి.
