ఇది ప్రైవేటు ఎయిడెడ్ పాఠశాల. కృష్ణ జిల్లాలో విజయవాడ అర్బన్ పరిధిలో విజయవాడ ( కార్ప్.) -2 గ్రామంలో ఈ పాఠశాల ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28161790898. ప్రైవేట్.సహాయక నిర్వహణలో ఈ పాఠశాల ఉన్నది. ఇక్కడ విద్యార్థులకు ఎనిమిదవ తరగతి వరకూ విద్యని తెలుగు మాధ్యమంలో భోదించబడుతుంది. ఇది బాల బాలికల పాఠశాల. మొత్తం 154 మంది విద్యార్థులలో డెబ్బై ఎనిమిది మంది బాలురు డెబ్బై ఆరు మంది బాలికలు ఈ పాఠశాల లో విద్యని అభ్యసిస్తున్నారు. ఇక్కడ ఆరుగురు ఉపాధ్యాయులు ఉన్నారు, వీరిలో అందరూ ఉపాధ్యాయినులే. <ref>{{cite web |title =School Directory |url = http://schoolreportcards.in/SRC-New/SchoolDirectory/Directory.aspx |website = schoolreportcards.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2017-18 విద్యా సంవత్సరమునకు సంబంధించినవి.
